import axios from 'axios';

const KEY = 'AIzaSyCXScVKrDMhCUXI2E5zhiZruUWohHidXW8';

export default axios.create({
    baseURL: 'https://www.googleapis.com/youtube/v3',
    params: {
      part: 'snippet', 
      type: 'video',
      maxResults: 5,
      key: `${KEY}`
  }
})
